CardGame.sol.content:
// SPDX-License-Identifier: GPL-3.0


pragma solidity >=0.8.2 <0.9.0;




import "./CardInventory.sol";


contract CardGame {
    CardInventory public inventory;
    uint public totalCardTypes = 5;


    event CardWon(address indexed user, uint cardId);


    constructor(address _inventory) {
        inventory = CardInventory(_inventory);
    }


    function spinWheel() external {
        uint random = uint(
            keccak256(abi.encodePacked(block.timestamp, msg.sender, block.prevrandao))
        ) % totalCardTypes;


        inventory.addCard(msg.sender, random, 1);
        emit CardWon(msg.sender, random);
    }
}

CardInventory.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.2 <0.9.0;




contract CardInventory {
    mapping(address => mapping(uint => uint)) private cardBalances;


    function addCard(address user, uint cardId, uint amount) external {
        cardBalances[user][cardId] += amount;
    }


    function removeCard(address user, uint cardId, uint amount) external {
        require(cardBalances[user][cardId] >= amount, "Not enough cards");
        cardBalances[user][cardId] -= amount;
    }


    function getBalance(address user, uint cardId) external view returns (uint) {
        return cardBalances[user][cardId];
    }
}

